import { View } from 'react-native'
import theme from '../../theme'
import ThemedText from '../ThemedText'

const ReviewItem = ({ review }) => {
	return (
		<View 
			style={{
				width: 20, 
				borderRadius: 100,
				borderWidth: 1,
				borderColor: theme.colors.primary
			}}>
			<ThemedText
				color='primary'
				fontWeight='bold'
				fontSize='subheading'
			>
				{review.rating}
			</ThemedText>
		</View>
	)
}

export default ReviewItem
